    false,nt"url": null,nt"notes": "This annual narrative report for J. Clark
    Salyer WMD outlines Refuge accomplishments during the 1971 calendar year. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, fish,
    and reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, vegetation control, and wildfires. Resource management
    is outlined; topics include grazing, haying, and fur harvesting. The public relations
    section of the report describes recreational uses and hunting. Items of interest,
    N-R forms, photographs, and newspaper articles are attached.",nt"license_title":
